private static String numberOfCalls(Integer count) {
        JSONObject jsonObject = new JSONObject();
        //系统业务量 xtywl
        JSONObject jsonObject1 = new JSONObject();
        jsonObject1.put("ywcdl", count);
        //主量纲
        jsonObject.put("ZLG", jsonObject1);
        return jsonObject.toString();
    }解析代码

解析如下代码：public String doPostJson(String apiUrl, Map<String, String> headers, String body) {

        HttpPost httpPost = new HttpPost(apiUrl);

        // *) 配置请求headers
        if (headers != null && headers.size() > 0) {
            for (Map.Entry<String, String> entry : headers.entrySet()) {
                httpPost.addHeader(entry.getKey(), entry.getValue());
            }
        }

        StringEntity entity = new StringEntity(body, "utf-8");
        entity.setContentType("application/json");
        httpPost.setEntity(entity);

        CloseableHttpResponse response = null;
        try {
            response = httpClient.execute(httpPost);
            if (response == null || response.getStatusLine() == null) {
                return null;
            }

            int statusCode = response.getStatusLine().getStatusCode();
            if (statusCode == HttpStatus.SC_OK) {
                HttpEntity entityRes = response.getEntity();
                if (entityRes != null) {
                    return EntityUtils.toString(entityRes, "UTF-8");
                }
            }
            return null;
        } catch (IOException e) {
        } finally {
            if (response != null) {
                try {
                    response.close();
                } catch (IOException e) {
                }
            }
        }
        return null;

    }
